import React, { useState, useEffect } from 'react';
import axios from 'axios';
import styles from './SuperAdminReports.module.css';

const SuperAdminReports = () => {
  const [data, setData] = useState({
    requests: [],
    totalResidents: 0,
    totalAdmins: 0
  });
  const [showDelayed, setShowDelayed] = useState(false);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchData = async () => {
      try {
        const [requestsRes, residentsRes, adminsRes] = await Promise.all([
          axios.get('http://localhost:8080/requests'),
          axios.get('http://localhost:8080/users/count'),
          axios.get('http://localhost:8080/admins/count')
        ]);

        setData({
          requests: requestsRes.data,
          totalResidents: residentsRes.data.count,
          totalAdmins: adminsRes.data.count
        });
      } catch (err) {
        setError('Failed to load report data');
        console.error(err);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  if (loading) return <div className={styles.container}>Loading reports...</div>;
  if (error) return <div className={styles.container}>{error}</div>;

  const totalRequests = data.requests.length;
  const completedRequests = data.requests.filter(req => req.status === 'Completed').length;
  const pendingRequests = totalRequests - completedRequests;
  const delayedRequests = data.requests.filter(req => 
    req.status === 'Pending' && 
    new Date(req.exceptCompletionDate) < new Date()
  );

  return (
    <div className={styles.container}>
      <h2>Super Admin Reports</h2>

      <div className={styles.summaryCards}>
        <div className={styles.card}>
          <h4>Total Requests</h4>
          <p>{totalRequests}</p>
        </div>
        <div className={styles.card}>
          <h4>Completed</h4>
          <p>{completedRequests}</p>
        </div>
        <div className={styles.card}>
          <h4>Pending</h4>
          <p>{pendingRequests}</p>
        </div>
        <div className={styles.card}>
          <h4>Delayed</h4>
          <p>{delayedRequests.length}</p>
        </div>
      </div>

      <div className={styles.delayedSection}>
        <h3>Delayed Requests</h3>
        <button 
          className={styles.toggleButton} 
          onClick={() => setShowDelayed(!showDelayed)}
        >
          {showDelayed ? 'Hide Delayed Requests' : 'Show Delayed Requests'}
        </button>
        
        {showDelayed && (
          <table className={styles.table}>
            <thead>
              <tr>
                <th>ID</th>
                <th>Resident</th>
                <th>Service</th>
                <th>Status</th>
                <th>Expected Completion</th>
              </tr>
            </thead>
            <tbody>
              {delayedRequests.map(req => (
                <tr key={req.requestId}>
                  <td>{req.requestId}</td>
                  <td>{req.userId}</td>
                  <td>{req.serviceId}</td>
                  <td className={styles[req.status.toLowerCase()]}>{req.status}</td>
                  <td>{new Date(req.exceptCompletionDate).toLocaleDateString()}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>

      <div className={styles.countSection}>
        <div className={styles.countCard}>
          <h3>Total Registered Residents</h3>
          <p>{data.totalResidents}</p>
        </div>
        <div className={styles.countCard}>
          <h3>Total System Admins</h3>
          <p>{data.totalAdmins}</p>
        </div>
      </div>
    </div>
  );
};

export default SuperAdminReports;
